import React, { Component } from 'react';
import frame from './frame.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <div><input className="input-link"></input></div>
        <div>
        {/* <svg width="584" height="584" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink" viewportFill="white">
          <defs>
            <clipPath id="image-clip-path">
              <rect x="178" y="178" width="228" height="228"/>
            </clipPath>
          </defs>

          <image clip-path="url(#image-clip-path)" id="image" x="178" y="178" width="228" height="228" 
            xlinkHref="https://s3.eu-central-1.amazonaws.com/periodica-main/public/photo_dpi72.jpg" preserveAspectRatio="xMidYMid slice"/>


        </svg> */}
        <img src={frame}/>
        </div>
      </div>
    );
  }
}

export default App;
